import React, { useState } from 'react'

const Cnt2 = () => {
  const {cnt,setCnt} = useState(0);
  return (
    <div>
      <button onClick={()=>{
        setCnt(cnt => cnt+1)
      }}>+1</button>
      <button onClick={function(){
        setCnt(cnt => cnt-1)
      }}>-1</button>
    </div>
  )
}

export default Cnt2
